import React, {useEffect, useState} from 'react';
import axios from 'axios';

class ProductService{
    getProducts = async() => {
        let products ;
        async () => {
            const response = await axios.get("http://localhost:8080/products/");
            products = response.data;
        };
        return(products);
    }
}
